import Navbar from './Components/Navbar';
import { Routes,Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Routes>
        <>
        <OrderForm/>
        <AddMeals/>
        <Delete/>
        <Home />
        <About/>
        </>
      </Routes>


      </div>
  )
}
export default App;
